  false,\n\t\"url\": null,\n\t\"notes\": \"These GIS files represent geographic boundaries
  for lands that are under the protection of NYS Agricultural District Law, administered
  by the New York State Department of Agriculture and Markets. The boundaries are
  derived from county tax parcel data and represent a tax parcel list of agricultural
  district properties. The data are digitized from 1:24,000 scale maps of individual
  districts showing boundaries that correspond to tax parcel data. District data is
  joined into a file representing an entire county. Note that 2003 legislation allows
  lands to be added to districts on an annual basis. Electronic data provided here
  may predate those additions. Tax parcel detail and secondary rights-of-way are not
  included in this dataset. Rights-of-way for state and federal highways, railroads
  and utilities are only included when they are delineated on the original 1:24,000
  scale maps. The data files are in ArcInfo 9.1 export file format.\",\n\t\"license_title\":
